  18,\n\t\"tags\": [],\n\t\"title\": \"Dissolved inorganic carbon, pH, alkalinity,
  temperature, salinity and other variables collected from discrete sample and profile
  observations using Alkalinity titrator, CTD and other instruments from the CHARLES
  DARWIN in the Indian Ocean from 2002-03-01 to 2002-04-15 (NODC Accession 0108226)\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-09-26T22:55:29.136466\",\n\t\"name\": \"dissolved-inorganic-carbon-ph-alkalinity-temperature-salinity-and-other-variables-collected-fro43653\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0108226 includes chemical,
  discrete sample, physical and profile data collected from CHARLES DARWIN in the
  Indian Ocean from 2002-03-01 to 2002-04-15 and retrieved during cruise (CD139) and
  74AB20020301. These data include ALKALINITY, CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-113
  (CFC-113), CHLOROFLUOROCARBON-12 (CFC-12), Carbon tetrachloride (CCL4), DELTA HELIUM-3,
  DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN, HELIUM, HYDROSTATIC PRESSURE, NEON,
  NITRATE, PHOSPHATE, Potential temperature (theta), SALINITY, SILICATE, TRITIUM,
  WATER TEMPERATURE and pH. The instruments used to collect these data include Alkalinity
  titrator, CTD, Coulometer for DIC measurement, Spectrophometer for pH measrement
  and bottle. These data were collected by M. Alvarez of Commonwealth Scientific and
  Industrial Research Organization, Aida F. Rios of Instituto de Investigaciones Marinas;
  Departamento de Oceanograffa and H. Bryden [affiliation unknown] as part of the
  CLIVAR_I05_2002 data set.nnThe International CLIVAR Global Ocean Carbon and Repeat
  Hydrography Program carries out a systematic and global re-occupation of select
  WOCE/JGOFS hydrographic sections to quantify changes in storage and transport of
  heat, fresh water, carbon dioxide (CO2), and related parameters.\",\n\t\"license_title\":
